import React, { Component } from "react";
import 'bootstrap/dist/js/bootstrap.js';

import 'mdb-react-ui-kit/dist/css/mdb.min.css';


export default class test extends Component {
    constructor(props) {//getting data
        super(props);
        this.state = {
            userData: "",
        };
    }

    componentDidMount() {
        fetch("http://localhost:5000/test", {
            method: "POST",
            crossDomain: true,
            headers: {
                "Content-Type": "application/json",
                Accept: "application/json",
                "Access-Control-Allow-Origin": "*",
            },
            body: JSON.stringify({
                token: window.localStorage.getItem("token")

            }),
        })
            .then((res) => res.json())
            .then((data) => {
                console.log(data, "userData");
                this.setState({ userData: data.data });//getting data
                /*if( data.data == "token expired") {
                    alert("token expired login again");
                    window.localStorage.clear();
                    window.location.href = "./sign-in";
                }*/
            });
    }
    logOut = () => {
        window.localStorage.clear();
        window.location.href = "./sign-in";
    }



    render() {
        return (
            //getting data displayed on Dashboard
            
            <div>
                <nav class="navbar navbar-light bg-light">
                    <div class="container-fluid">
                        <button class="navbar-toggler" type="button" data-mdb-toggle="collapse"
                            data-mdb-target="#navbarToggleExternalContent" aria-controls="navbarToggleExternalContent"
                            aria-expanded="false" aria-label="Toggle navigation">
                            <i class="fas fa-bars"></i>
                        </button>
                    </div>
                </nav>
                <div class="collapse" id="navbarToggleExternalContent">
                    <div class="bg-light shadow-3 p-4">
                        <button class="btn btn-link btn-block border-bottom m-0">Link 1</button>
                        <button class="btn btn-link btn-block border-bottom m-0">Link 2</button>
                        <button class="btn btn-link btn-block m-0">Link 3</button>
                    </div>
                </div>
                Name<h1>{this.state.userData.fname} {this.state.userData.lname}</h1>
                Email<h1>{this.state.userData.email}</h1> <br />
                <button class="btn btn-danger" color="pink" onClick={this.logOut}>Log Out</button>
            </div>
        )
    }
}
